import React, {useState} from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import TextField from "@mui/material/TextField";
import PillLogo from './pill.svg';

export default function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const handleSubmit = e => {
        e.preventDefault();
        console.log(username, password);
        e.target("/main-menu");
    };

    return (
        <div style={{display: "flex", alignItems: "center", justifyContent: "center", flexDirection: "column"}}>
            <div style={{marginBottom: "50px"}}>
                <img src={PillLogo} alt="Pill Logo" style={{
                    filter: "invert(100%) sepia(0%) saturate(0%) hue-rotate(231deg) brightness(103%) contrast(101%)",
                    height: "300px"
                }}/>
            </div>

            <Card variant="outlined" sx={{p: 5}}>
                <form onSubmit={handleSubmit}>
                    <Box
                        sx={{
                            "& .MuiTextField-root": {mb: 7.5, width: "100%"},
                        }}
                    >
                        <TextField
                            required
                            id="userInput"
                            name="userInput"
                            label="Username"
                            type="search"
                            value={username}
                            onChange={e => setUsername(e.target.value)}
                        />

                        <TextField
                            required
                            id="passwordInput"
                            name="passwordInput"
                            label="Password"
                            type="search"
                            value={password}
                            onChange={e => setPassword(e.target.value)}
                        />

                        <Button variant="contained" size="large" type="submit"
                                sx={{fontSize: "17px", height: "5.75ch", width: "100%"}}>Login</Button>
                    </Box>
                </form>
            </Card>
        </div>
    );
}
